import React, {FC, Dispatch, SetStateAction} from 'react';

import classes from './Title.module.scss';

interface Props {
	tomorrow: boolean;
	setTomorrow: Dispatch<SetStateAction<boolean>>;
}

const Title: FC<Props> = ({tomorrow, setTomorrow}) => {

	return (
			<header>
				<h1>
					Расписание собак на
					<span
						onClick={() => setTomorrow(!tomorrow)}
						className={classes.date}
					>{!tomorrow ? ' сегодня' : ' завтра'}</span>
				</h1>
			</header>
	);
};

export default Title;
